import Header from "../components/Header";

function Home() {
  return (
    <>
      <Header />
      <div style={{ padding: "40px", textAlign: "center" }}>
        <h1>Welcome to AI Health Assistant</h1>
        <p>You are logged in with a verified email.</p>
      </div>
    </>
  );
}

export default Home;
